import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="nav">
      <img
        className="nav_logo"
        src="https://onlystyleremains.be/wp-content/uploads/2020/09/Netflix.png" alt="Netflix Logo"
      />
    </div>
  );
};

export default Navbar;
